import React from 'react';
import NavBar from './components/NavBar';
import Login from './components/user/Login';
import Loading from './components/Loading';
import Notification from './components/Notification';
const App=()=>{
  return(
    <>
    <Loading/>
    <Notification/>
    <Login/>
    <NavBar/>
    </>
    
)
}

export default App;
